import React from 'react'
import animationData from "../../Assets/followers.json"
import Lottie from 'react-lottie';

export default function FollowersAnimate() {
       const Followers = {
              loop: true,
              autoplay: true,
              animationData: animationData,
              rendererSettings: {
                     preserveAspectRatio: "xMidYMid slice"
              }
       };
       return (
              <div>
                     <Lottie 
                     options={Followers}
                     width={120}
                     height={150}
                     />
              </div>
       )
}
